import { Button, Container, Form, InputGroup, Stack } from "react-bootstrap";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
import { Link } from "react-router-dom";

import IconStar from "../../../images/other_stars.png";
import Divider from "../../../images/divider.png";
import logo from "../../../images/logo.PNG";
import "../../../style.css";
import QRCode from "react-qr-code";
import StaffCaroussel from "./StaffCaroussel";
import { useState } from "react";

function PrivateHomeClient() {
  const [selectedPriceTag, setSelectedPriceTag] = useState(null);

  return (
    <Container className="gx-0 fluid ">
      <Stack>
        <div className=" mx-auto">
          <img className="logo" src={logo} alt="logo" />
        </div>
        <StaffCaroussel />
        <div className="mx-auto">
          <img
            style={{ width: "16%", height: "6%", marginRight: "7px" }}
            src={IconStar}
            className="image_selectRole"
            alt="icon"
          />
          <img
            style={{ width: "16%", height: "6%", marginRight: "7px" }}
            src={IconStar}
            className="image_selectRole"
            alt="icon"
          />
          <img
            style={{ width: "16%", height: "6%", marginRight: "7px" }}
            src={IconStar}
            className="image_selectRole"
            alt="icon"
          />
          <img
            style={{ width: "16%", height: "6%", marginRight: "7px" }}
            src={IconStar}
            className="image_selectRole"
            alt="icon"
          />
          <img
            style={{ width: "16%", height: "6%", marginRight: "7px" }}
            src={IconStar}
            className="image_selectRole"
            alt="icon"
          />
        </div>
        <div className="mx-auto mb-4">
          <img
            style={{ width: "82%", height: "1px" }}
            src={Divider}
            className="image_selectRole"
            alt="icon"
          />
        </div>
        <div className="mx-auto mb-4">
          <Button className="price-button">{"$ 1.25"}</Button>
          <Button className="price-button">{"$ 1.50"}</Button>
          <Button className="price-button">{"$ 1.75"}</Button>
          <Button className="price-button">{"$ 2.00"}</Button>
        </div>

        <div className=" d-flex justify-content-center form-mt-74" sm={12}>
          <Form>
            <InputGroup className="mb-4">
              <Form.Control
                type="text"
                placeholder="Enter Amount"
                className="customForm1"
                style={{ height: "65px" }}
              />
              <Form.Control
                type="text"
                placeholder="Leave a comment"
                className="customForm1"
                style={{ height: "95px" }}
              />
            </InputGroup>

            <div className="">
              <Button type="submit" className="customButton1">
                Pay ({"$2.5"})
              </Button>
            </div>
          </Form>
        </div>
      </Stack>
    </Container>
  );
}

export default PrivateHomeClient;
